INSERT INTO `app_product` VALUES (3,'Điện thoại Samsung Galaxy A05s (4GB/128GB) - Đã kích hoạt bảo hành điện tử - Hàng chính hãng',3950000,'<p>Samsung Galaxy A05s là chiếc smartphone giá rẻ hiệu năng cao, sở hữu con chip Snapdragon 680 đầu tiên trong phân khúc, giúp người dùng tận hưởng trải nghiệm mượt mà và ổn định. Điện thoại còn được đánh giá cao với viên pin lên đến 5.000mAh, hệ thống camera gồm 3 ống kính 50MP chất lượng và màn hình lớn nhất từ trước đến nay trong dòng Galaxy A.</p>\r\n<img  style=\"width:600px; height:320px;\" src=\"https://cdn2.fptshop.com.vn/unsafe/564x0/filters:quality(80)/Uploads/images/2015/Tin-Tuc/hongtt34/camera-Samsung-Galaxy-A05s-3.jpg\" />','ffd8231bf72a999dbb387e92ea50c48b.jpg.png','f44a20a4fc9637d39905e4ac4f4f47cd.jpg.png','c1b3d6d8777186db0ea5881b74fc1930.jpg.png','44fc2af9d89bbd4fa1a72db283d2a95e.jpg.png','9c487bc23c485e4e1c2d63f37b5d7d81.jpg.png','<table border=\"1\" cellpadding=\"8\">\r\n    <tr>\r\n        <td><strong>Dung lượng pin:</strong></td>\r\n        <td>5000 mAh</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Bluetooth:</strong></td>\r\n        <td>v5.1</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Thương hiệu:</strong></td>\r\n        <td>Samsung</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Xuất xứ thương hiệu:</strong></td>\r\n        <td>Hàn Quốc</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Camera sau:</strong></td>\r\n        <td>Chính 50 MP & Phụ 2 MP, 2 MP</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Camera trước:</strong></td>\r\n        <td>13 MP</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Hỗ trợ thẻ nhớ ngoài:</strong></td>\r\n        <td>MicroSD, hỗ trợ tối đa 1 TB</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Chip đồ họa (GPU):</strong></td>\r\n        <td>Adreno 610</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Chip set:</strong></td>\r\n        <td>Snapdragon 680 8 nhân</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>NFC:</strong></td>\r\n        <td>Không</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Tốc độ CPU:</strong></td>\r\n        <td>4 nhân 2.4 GHz & 4 nhân 1.9 GHz</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Loại/ Công nghệ màn hình:</strong></td>\r\n        <td>PLS LCD</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Hỗ trợ 4G:</strong></td>\r\n        <td>Có</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Phụ kiện đi kèm:</strong></td>\r\n        <td>Sách hướng dẫn, Que chọc SIM, Cáp sạc USB Type-C</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Jack tai nghe:</strong></td>\r\n        <td>3.5 mm</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Số sim:</strong></td>\r\n        <td>2</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Loại pin:</strong></td>\r\n        <td>Li-Po</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Loại Sim:</strong></td>\r\n        <td>Nano Sim</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Xuất xứ (Made in):</strong></td>\r\n        <td>Trung Quốc</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Cổng sạc:</strong></td>\r\n        <td>Type-C</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Trọng lượng sản phẩm:</strong></td>\r\n        <td>194 g</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>RAM:</strong></td>\r\n        <td>4GB</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Độ phân giải:</strong></td>\r\n        <td>Full HD+ (1080 x 2400 Pixels)</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>ROM:</strong></td>\r\n        <td>128GB</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Wifi:</strong></td>\r\n        <td>Wi-Fi Direct / Wi-Fi 802.11 a/b/g/n/ac / Dual-band (2.4 GHz/5 GHz)</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Sản phẩm có được bảo hành không?</strong></td>\r\n        <td>Có</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Hình thức bảo hành:</strong></td>\r\n        <td>Điện tử</td>\r\n    </tr>\r\n    <tr>\r\n        <td><strong>Thời gian bảo hành:</strong></td>\r\